import {makeStyles} from '@material-ui/core/styles';

export const useStyles = makeStyles((theme) => ({
    root: {
        marginTop: '50px',
        '& div.user-menu-wrapper': {
            '& > div': {
                marginBottom: '10px',
            },
        },
    },
}));
